import React from 'react';
import GameScreen from '../GameScreen';
import TestPage from '../mainPage/test';

const IntroPage = ({ setGameScreen }) => {

    const startGame = () => {
        setGameScreen(<TestPage />);
    }

    return (
        <GameScreen>
            <div className='header'>
                <h1>Space Invaders</h1>
            </div>
            <div className='credits'>
                <div className='col-1'>
                    <h3>Credits</h3>
                    <p>Reproduced By:</p>
                    <p>Developed Using:</p>
                </div>
                <div className='col-2'>
                    <p>Team Whoever</p>
                    <p>React JS</p>
                </div>
                <div className='col-3'>
                    <button className='Start-btn' onClick={startGame}>Start</button>
                </div>
            </div>
        </GameScreen>
    )
}

export default IntroPage;
